import React from "react";

export default function EbookMonthlyMCQs() {
  return (
    <div className="page-container">
      <h1>Current Affairs Monthly MCQs</h1>
      <p>Monthly MCQs for UPSC, SSC, Banking & State PSC exams.</p>
    </div>
  );
}
